Hello, is this Neovide? Not really a configuration option, but g:neovide only exists and is set to v:true if this Neovim is in Neovide. Useful for configuring things only for Neovide in your init.vim/init.lua: VimScript: if exists("g:neovide") " Put anything you want to happen only in Neovide here
endif Lua: if vim.g.neovide then -- Put anything you want to happen only in Neovide here
end You can also query the version with: echo g:neovide_version Lua: vim.print(vim.g.neovide_version) Or inspect the more detailed channel information: Lua: lua vim.print(vim.api.nvim_get_chan_info(vim.g.neovide_channel_id))

