macOS Option Key is Meta Possible values are both, only_left, only_right, none. Set to none by default. VimScript: let g:neovide_input_macos_option_key_is_meta = 'only_left' Lua: vim.g.neovide_input_macos_option_key_is_meta = 'only_left' Available since 0.13.0. Interprets Alt + whatever actually as <M-whatever>, instead of sending the actual special character to Neovim. IME VimScript: let g:neovide_input_ime = v:true Lua: vim.g.neovide_input_ime = true Available since 0.11.0. This lets you disable the IME input. For example, to only enables IME in input mode and when searching, so that you can navigate normally, when typing some East Asian languages, you can add a few auto commands: augroup ime_input autocmd! autocmd InsertLeave * execute "let g:neovide_input_ime=v:false" autocmd InsertEnter * execute "let g:neovide_input_ime=v:true" autocmd CmdlineLeave [/\?] execute "let g:neovide_input_ime=v:false" autocmd CmdlineEnter [/\?] execute "let g:neovide_input_ime=v:true"
augroup END local function set_ime(args) if args.event:match("Enter$") then vim.g.neovide_input_ime = true else vim.g.neovide_input_ime = false end
end local ime_input = vim.api.nvim_create_augroup("ime_input", { clear = true }) vim.api.nvim_create_autocmd({ "InsertEnter", "InsertLeave" }, { group = ime_input, pattern = "*", callback = set_ime
}) vim.api.nvim_create_autocmd({ "CmdlineEnter", "CmdlineLeave" }, { group = ime_input, pattern = "[/\\?]", callback = set_ime
}) Touch Deadzone VimScript: let g:neovide_touch_deadzone = 6.0 Lua: vim.g.neovide_touch_deadzone = 6.0 Setting g:neovide_touch_deadzone to a value equal or higher than 0.0 will set how many pixels the finger must move away from the start position when tapping on the screen for the touch to be interpreted as a scroll gesture. If the finger stayed in that area once lifted or the drag timeout happened, however, the touch will be interpreted as tap gesture and the cursor will move there. A value lower than 0.0 will cause this feature to be disabled and all touch events will be interpreted as scroll gesture. Touch Drag Timeout VimScript: let g:neovide_touch_drag_timeout = 0.17 Lua: vim.g.neovide_touch_drag_timeout = 0.17 Setting g:neovide_touch_drag_timeout will affect how many seconds the cursor has to stay inside g:neovide_touch_deadzone in order to begin "dragging" Once started, the finger can be moved to another position in order to form a visual selection. If this happens too often accidentally to you, set this to a higher value like 0.3 or 0.7.

